from operator import itemgetter


class Similarity:

    @staticmethod
    def ranked_sim_scores(sim_scores: dict, n_best=10):
        if n_best > len(sim_scores):
            n_best = len(sim_scores)

        return dict(sorted(sim_scores.items(), key=itemgetter(1), reverse=True)[:n_best])


    @classmethod
    def compute_sims(cls, uid_mutual_following_counts: dict, live_uids_tot_followers: dict):
        similarity_scores = {}
        sum_mutual_followings = sum(uid_mutual_following_counts.values())
        for uid, total_followers in live_uids_tot_followers.items():
            similarity_scores.update(
                {uid: cls.sim(uid_mutual_following_counts.get(uid, -1), total_followers, sum_mutual_followings)})

        return similarity_scores


    @staticmethod
    def sim(uid_mutual_count, live_uid_total_followers, sum_mutual_followings):
        raise NotImplementedError



class SorensenDiceSim(Similarity):

    @staticmethod
    def sim(uid_mutual_count, live_uid_total_followers, sum_mutual_followings):
        result = -1
        if live_uid_total_followers + sum_mutual_followings != 0:
            result = (2 * uid_mutual_count) / (live_uid_total_followers + sum_mutual_followings)

        return result


class JaccardSim(Similarity):

    @staticmethod
    def sim(uid_mutual_count, live_uid_total_followers, sum_mutual_followings):
        result = -1
        if live_uid_total_followers + uid_mutual_count != 0:
            result = uid_mutual_count / (sum_mutual_followings + live_uid_total_followers - uid_mutual_count)

        return result




